import React from "react";

export default function ResumePersonals() {
  return (
    <div className="personals">
      <div className="image"></div>
      <div className="updated-personals">
        <p className="name-value">Stephen Mwangi Muiyuro</p>
        <p className="title-value">Front-End Developer</p>
        <p className="cell-value">+254 720 590 378</p>
        <p className="email-value">stevemuiyuro@gmail.com</p>
        <a href="https://www.linkedin.com/in/steve-mwangi/">LinkedIn</a>
      </div>
      <hr className="divider" />
    </div>
  );
}
